column8:
アロマポットやディフューザーでお使いください。１０種類の精油をブレンド。ティッシュに１滴落としてマスクに忍ばせれば、マスク内も爽快。<br><table width="600" border="0" style="font-size:100%"><tr style="width:" align="center"><th width="576" style="background-color:#D2CAC4; color:#FFF; letter-spacing:1px; padding:10px">商品詳細</th></tr><tr><td><table width="594" border="0" cellpadding="7" cellspacing="1" bgcolor="#D2CAC4" style="font-size:95%; line-height:130%; letter-spacing:110%"><tr bgcolor="#999999"><td width="110" height="25" bgcolor="#F4F0EC" align="center">商品番号</td><td width="453" bgcolor="#ffffff">sk191209</td></tr><tr bgcolor="#999999"><td  height="25" bgcolor="#F4F0EC" align="center">原材料</td><td bgcolor="#ffffff">ユーカリ葉油、ペパーミント油、シベリアモミ油、レモン油、アトラスシダーウッド油、ティーツリー葉油、タイム油、アニス油、ジンジャー油、スパイクラベンダー油</td></tr><tr bgcolor="#999999"><td  height="25" bgcolor="#F4F0EC" align="center">内容量</td><td bgcolor="#ffffff">10ml</td></tr><tr bgcolor="#999999"><td height="25" bgcolor="#f4f0ec" align="center">使用期限</td><td bgcolor="#ffffff">製造日より1800日<br>＊メーカー在庫期間等を加味し、使用期限が8ヶ月以上ある商品は出荷しております。ご了承の上ご注文下さい。</td></tr><tr bgcolor="#999999"><td height="25" bgcolor="#f4f0ec" align="center">区分</td><td bgcolor="#ffffff">オーストラリア製・化粧品</td></tr><tr bgcolor="#999999"><td  height="25" bgcolor="#F4F0EC" align="center">広告文責</td><td bgcolor="#ffffff">有限会社自然館 0957-22-8770</td></tr><tr bgcolor="#999999"><td  height="25" bgcolor="#F4F0EC" align="center">販売元</td><td bgcolor="#ffffff">株式会社たかくら新産業</td></tr></table></td></tr></table><style type=”text/css”>
